import { CanvasExtension } from "./CanvasExtension.js";
export class CanvasExtensionProvider {
  shouldExtend(designItem) {
    if (getComputedStyle(designItem.element).display == 'block') return true;
    return false;
  }

  getExtension(designerView, designItem) {
    return new CanvasExtension(designerView, designItem);
  }

}